import React from 'react'

//pure function
const Navigation = ({onRouteChange, isSignedIn}) => {
  if(isSignedIn) {
    return(
      <nav style ={{display: 'flex', justifyContent: 'flex-end'}}>
        <p onClick={() => onRouteChange('signout')} className = 'f3 link dimblack underline pa3 pointer'> Sign Out </p>
      </nav>
    );
  }else{
    return (
      <nav style ={{display: 'flex', justifyContent: 'flex-end'}}>
        <p onClick={() => onRouteChange('signin')} className = 'f3 link dimblack underline pa3 pointer'> Sign In </p>
        <p onClick={() => onRouteChange('register')} className = 'f3 link dimblack underline pa3 pointer'> Register </p>
      </nav>
    );
  }
}

export default Navigation;
